                </div>
            </div>
         </div>
    </div>

{% endblock %}", "registration/register.html.twig", "/Users/maxencejoly/Desktop/W-PHP-502-MAR-2-2-Quiz-hugo.ribaud/my_quiz/templates/registration/register.html.twig");
